import React from 'react';
import sendPost from '../api/hook';
const disp = sendPost('http://192.168.0.103:8080/recentword',{test:'testing'});
const Display = (disp) => {
        return (
                <div>
		<React.Fragment key='data'>
			<p>{disp}</p>
		</React.Fragment>
                </div>
        );
}

export default Display;
